          "ENG": "The Laienbühne Römerhof was founded on April 11, 1980 in the Talacker restaurant (now Siam House) in Oberwinterthur. At that time, the association consisted of a board member (Basil Scheck), three auditors and 13 limbs. The first theater that was performed under the name Laienbühne Römerhof was called \"e fabulous idea\". In the early days, the LA-RÖ played primarily on variety programs, mask balls, spring and autumn festivals. At that time the theater took place in spring and the La-Rö was regularly booked for so-called guest performances. This then meant to transport the entire scenes, furniture, decorative items, etc. back and forth. For example, everything was once brought to the Roman gate and then the next day back to the Catholic parish home St. Marien (today Kibez). Where we have enjoyed guest law since the La-Rö foundation. Soon the few demonstrations were only fully booked after a very short time. The theater autumn, as it still takes place today, was launched. From 1990 the final end for the carnival theater. The occasions will take place on five evenings and two afternoons (senior and family afternoons) in November. To date, the performances have always been visited very numerous, so that seven evening performances are currently taking place. The afternoon performances are particularly popular with our senior citizens and are always well attended. Not only theater is played in the lay stage. The togetherness in addition to the theater rehearsals and performances is also very important. On the 1st Thursday of the month, the members meet in the Blume restaurant in Oberwinterthur. The family veloplausch will take place on May 1st and the La-Rö hike in autumn. And of course not to forget are our common theater visits and the \"Oberi-Fäscht\", where we have been present for 20 years with our Theaterbeiz \"Roter Ballon\". The association is neither politically nor denominational and today consists of 40 active members and 240 stage worms, chaired by Walter Hämmerli and his board team. The foundation of the Laienbühne Römerhof association was literally: \"e fabulous idea\".",
