          "ENG": "We are a group of young people who have been playing and organizing theater together since 1999. We are aged 16 to 26 and from the Winterthur area. Our goal is to give everyone a chance that want to make theater in any way. We are organized as an association and if you want to join, you pay an annual membership fee of CHF 50. The theater is managed by a board, a hand fully more experienced members. What do we do? As a rule, we bring plays a bit on stage once a year. With our projects, we try to tackle everything ourselves without professional help. Everyone can be a stage designer, actress, director, technician, costume designer. The entire production is therefore entirely in the hands of the club members. We are therefore dependent on great use of everyone. The performances usually take place in the Theater am Gleis in Winterhur. Improvisation theater react live to the bizarre ideas of the audience and still be funny? In the improvisation theater we train the quick wit, spontaneity and creativity! Since the beginning of 2009 we have been training the appearance again without memorized text. The participants who want to make a sample. The aim is that we will be good enough for public improvements in a few months. In order to achieve this, we organize an internal impro course with a theater educator in May 09. For the first time, the U16 junior group offered a theater course for less than 16 years from March to June. The U16 appeared in the Theater am Gleis at the end of June with \"How to Become Rich\". Further activities at the Junge Theater Winterthur are not only important to play theater itself. We also design club life. In February 2009 we were in the Alpamare, after the general assembly on May 3, 2009, a barbecue chat in the forest is planned. Sometimes we also visit theater performances or theater sports performances together. We are open to new ideas and always happy if you want to organize something.",
          "UKR": "Ми - група молодих людей, які разом грають та організовують театр разом з 1999 року. Ми віком від 16 до 26 років і з району Вінтертура. Наша мета - дати всім шанс, що хочуть зробити театр будь -яким чином. Ми організовані як асоціація, і якщо ви хочете приєднатися, ви сплачуєте щорічний членський внесок у розмірі 50 CHF. Театром керує дошка, рука, повністю досвідчених членів. Що ми робимо? Як правило, ми приносимо ігри трохи на сцені раз на рік. З нашими проектами ми намагаємось вирішити все без професійної допомоги. Кожен може бути сценічним дизайнером, актрисою, режисером, техніком, дизайнером костюмів. Тому вся виробництво повністю знаходиться в руках членів клубу. Тому ми залежать від великого використання всіх. Виступи зазвичай відбуваються в театрі AM Gleis у Вінтерхур. Театр імпровізації реагує в прямому ефірі на химерні ідеї глядачів і все ще буде смішним? У театрі імпровізації ми навчаємо швидку кмітливість, спонтанність та творчість! З початку 2009 року ми знову тренували зовнішній вигляд без запам'ятовуваного тексту. Учасники, які хочуть зробити зразок. Мета полягає в тому, що ми будемо достатньо хорошими для громадських вдосконалень за кілька місяців. Для того, щоб досягти цього, ми організовуємо внутрішній курс вдосконалення з театральним педагогом 09 травня. Вперше молодша група U16 пропонувала театральний курс менше 16 років з березня по червень. U16 з’явився в театрі AM Gleis наприкінці червня з \"Як стати багатим\". Подальші заходи в театрі Джунге Вінтертур не тільки важливі для того, щоб грати в театр. Ми також розробляємо життя клубу. У лютому 2009 року ми були в Альпамаре, після Генеральної Асамблеї 3 травня 2009 року планується чат з барбекю в лісі. Іноді ми також відвідуємо театральні вистави або театральні спортивні вистави разом. Ми відкриті до нових ідей і завжди щасливі, якщо ви хочете щось організувати.\n"
