          "UKR": "Попеляльна середа, що використовується в Елгг -Елгг та попелях середа, - це два терміни, що належать разом. Але що таке äschli, як це посилається? Це звичай, який старше 500 років, який знаходить свою щорічну родзинку в попелі середи з парадом хлопчика. Походження лежить у дореформальний час, коли в ELGG були проведені закономірності для військ під власним прапором або для найманців. Точне походження не відоме. Однак у своїй парафіяльній книзі Пастор Фасі в 1628 році він був дуже старим звичаєм в Елггу. Товариство попелястої середи, яке взяло на себе цей звичай, було запущено в 1914 році і наразі має близько 650 членів. З двадцятих років двадцятих років також були періодично великі кроки, здебільшого з історичним походженням та фестивалем. Щороку в Новий рік молодий та старий збирається в Оберторі, де молода команда Елггера обрали відповідний Ашліхаупман та всю команду у відкритому голосуванні. Будь -який хлопчик може виступати за вибори, але Aklikarrier - це перевага. Усі хлопці з п'яти років, поки шкільні листки не зможуть брати участь у вправах та переїзді. З новорічного дня до попелу в середу, вправи відбудуться різними способами по суботах та неділях.\n"
