          "UKR": "Курси танцю Wing & Boogie Woogie для початківців та просунуті вечірки з Swing, Boogie Woogie, Rhythm'n'blues про те, що дізналося, що таке Boogie woogie? Boogie Woogie - це стиль музики, який був створений чорними джазовими музикантами у 30 -х та 40 -х роках. У той час танцювали Лінді Хоп і Сюн. Танець, який ми називаємо Boogie Woogie, був розроблений не в Америці - а на основі старих танцювальних фільмів з Америки - в Німеччині, Італії та Франції. У Швейцарії інтерес до цього танцю прокинувся близько 15 років тому. Характерними для танцю Boogie Woogie є швидка робота, лідерство та гармонія між партнерами, а також намагання до безкоштовної інтерпретації музики. Boogie Woogie - близький родич Лінді -хоп, який в основному танцюється до Rythm'n'blues і старших рок -н -ролл. Однак, певною мірою, це європейський колега американського стилю танцю початку 50er з незалежним акцентом та персонажем.\nВи можете знайти більше інформації на нашій домашній сторінці."
