          "UKR": "Від Шюшахтла до Культурслахтл!\nСередня школа в Кроненвізе була побудована в роки після розлуки шкільної громади Кілхберга в Адлісвілі з 1892 року. У 1910 р. Була отримана нова шкільна будівля, а спортзал Кроненвізе або Шюхшахтл, оскільки будівля була названа через форму, Спочатку подавали відтоді на тренажерному залі Adliswils. У 1947 році після ремонту було додано крило з гардеробу, яке сьогодні служить фойє. Після оновлення шкільної будівлі в 1991–1993 роках та створенню спортивного закладу Tüfi, Schueh Schachtle навряд чи використовувався для шкільних цілей. Джуроклуб Сіхлтал розширив підвалу вбиття Шуе до доджо для його потреб у навчанні. Починаючи з 2000 року, театр Адлісвіла виконує свою постановку в Шухшахла, яка перетворюється на театр. У співпраці з міською радою Адлісвіл робоча група театру Адлісвіл у 2003 році вперше розробила можливу експлуатаційну ідею, оскільки Schuehshthtle може бути використаний як культурний район більш регулярно і навіть ширше. Міська рада Адлісвіл затвердила позику на конверсію на Schueh Slat близько 600 000 швейцарських швейцарських на кінець 2005 року. Незалежне спонсорство - Асоціація Культуршахтл Адлісвіл - була заснована в 2006 році і, безумовно, зробила Шухшахтл культурною прорізом."
