          "ENG": "In the Cevi we experience game, sports, fire, learning directions, knots, morsen, first aid pione technology and behavior in nature on our Saturday afternoons. We are on the road a lot and also have many beautiful warehouses. The thread in our adventures usually form the stories from the Bible or events from world history. The forest is an ideal place for our programs. We attach great importance to age -appropriate programs and games. We have different stages that are divided according to age and gender. Each group is managed by one or more trained young people who are prepared for their conductor's job in function -related leading courses. There are always adult leaders on site. The children's ability to work in a team is promoted. It is also important that the children learn to deal responsibly with nature and its environment.",
