          "UKR": "Байкери проти жорстокого поводження з дітьми (B.A.C.A.) існує для створення безпечнішого середовища для жорстоких дітей. Ми - група байкерів з метою надати дітям сили, не маючи змоги жити в цьому світі без страху. Ми беремо участь у наших постраждалих друзів, взявши їх у встановлену об'єднану організацію. Ми працюємо з існуючими місцевими та державними організаціями захисту дітей та органами. Ми хочемо надіслати чітке повідомлення всім, хто має відношення до зловживаної дитини, що ця дитина є частиною нашої організації і що ми готові підтримувати дитину фізично та емоційно з нашою присутністю та належністю. Ми готові захистити цих дітей від подальших зловживань. Ми відкидаємо використання насильства будь -якого способу. Однак якщо виникають обставини, що ми є єдиною перешкодою між дитиною та подальшими зловживаннями, то ми є цією перешкодою.\n"
