          "UKR": "Загальний опис діяльності асоціації\nАсоціація охорони природи Höri-Hochfelden активно зобов’язана підтримувати природні ландшафти муніципалітетів Геррі та Хохфельдена. Він підтримує дві громади у виконанні догляду за роботами (скошування, сіно, порізання дерев, деревини тощо) та сприяє захисту природи та навколишнього середовища через зв'язки з громадськістю. Асоціація охорони природи Höri-Hochfelden фінансує кольорову пустку в Lohwiesengraben та підтримує Центр охорони природи Neeracherried.\nЦілі асоціації\nАсоціація охорони природи має на меті зберегти природу та ландшафт у своїй красі та різноманітності, щоб запобігти знищенню або пошкодженню природної власності (тварин та рослин та місця проживання), захистити та підтримувати свої місця проживання та підтримувати свої місця проживання у створенні , збереження та допомогу відновити природні резерви та сприяти ідеям збереження природи в найширшому сенсі. Ми працюємо з родичами та представляємо інтереси природоохоронних інтересів у владі.\n\nРізноманітний\nАсоціація є членом Цюріхської кантональної асоціації захисту птахів (ZKV).\nАсоціація охорони природи Höri-Hochfelden має 135 членів. Плата за членство становить 40 CHF для окремих членів та 60 CHF для сімей. Молоді люди платять Chf 10th"
