          "ENG": "The Samaritan Association Bülach was founded in 1892 on the initiative of the men's pastor Herold and City Councilor Knus from Winterthur under the name \"Zum Roten Kreuz\". In the first few years, courses for the public took place in the town hall and in the school room, the final exams were public and were carried out on a Sunday morning. In 1895 the association was renamed \"Samaritan Association Bülach and the surrounding area\". After a member of the member of the turn of the century, various demanding alarm exercises and field exercises were carried out with other Samaritan associations in the following years. The first alarm group of the Samaritan Association was founded in 1913.",
