          "ENG": "The Kloten-Bülach Jets, founded in 2000, emerged from the merger of the two clubs UHC Giants Kloten (1983-2000) and the UHC Hornets Bülach (1989-2000). Taking into account the two fusion associations, the Kloten/Bülach location has contributed a significant share of the development of floorball sports in Switzerland. The team of the then Giants Kloten was able to cheer the title of Swiss champion (1987) two years after the founding of the SUHV, and players of the clubs involved were able to cover the national team dress in the course of the development. This both for the juniors and the active. In 2001, the association carried out the first issue of the Stargames in the sold -out Ruebisbachhalle in front of no less than 1000 spectators. The greatest success of the still young history of Kloten-Bülach Jets achieved the club in 2001 when the men were able to win the Swiss Cup final in Bern against serial champion Rot-Weiss Chur. In the area of ​​competitive sports, the teams are specifically promoted and trained. The focus is on performance and success. The players will be prepared for this path from the 14th year of age. In the area of ​​popular sports, the focus is on the joy of playing and general physical upgrading. We also pay great attention to promoting camaraderie, team spirit and fair, sporting behavior.",
