          "UKR": "Фонд сягає 1886 року. Тоді під назвою \"rhein-club eglisau\". З приєднанням до Швейцарської асоціації клубів водіння Понтоні в 1908\n\nСьогодні Понтонє Фарверейн, що має близько 40 активних членів, є однією з найбільших місцевих асоціацій Еглісау. Багато членів приїжджають з околиць до міста Рейн, щоб практикувати свій традиційний спорт.\n\nАсоціація має два навчальні місця. Рейн в Еглісау зберігається, що дає можливість нашому молодому понтону хороші можливості навчання та навчання. Активні учасники використовують ніжний струм для навчання кондиціонування або затишних атракціонів для чатів. У Rheinsfelden, який знаходиться на 5 км нижче за течією, всі члени виконують свої регулярні вправи. Навчальна зона починається приблизно на 200 метрів нижче електростанції. Залежно від рівня води, тенденції зміни Рейну через електростанцію. Ось чому ця секція річки дуже цікава і різноманітна для понтонів.\n\nБудинок клубу Pontoniere розташований в Еглісау. На першому поверсі він має матеріальне депо, і він пропонує місце для близько 60 людей на верхньому поверсі.\nВи можете знайти всю додаткову інформацію на нашій домашній сторінці."
