      "NOM": "50 - 100",
      "Description": {
          "ENG": "On May 15, 2002, the “Verein Bergwerk Riedhof” was founded in Aeugst on the Albis. The aim of the association is to maintain the memory of a regionally important industrial monument. During the Second World War, the Riedhof mine was the second largest coal mine in the canton of Zurich alongside Käpfnach-Horgen. Coal mining in the Riedhof mine near Aeugst am Albis 1786, a farmer discovered the coal deposit Riedhof during road work. Under state control by the canton of Zurich, a first breakdown phase between 1787 and 1814. In the absence of sufficient traffic closure, the dismantling was discontinued in 1814. The second mining phase began in 1917 during the First World War. In 1919, after several changes of ownership, a Zurich construction company took the dismantling on the hand. Stollen were driven crisscrossed: the company was mostly unprofitable. The company got into high debts and the tunnels were closed in 1921. At times, however, up to 30 workers in the mine were employed in this period. In total, however, only about 1200 tons of coal were promoted. During the Second World War, dismantling took place again. In 1942, Gebrüder Sulzer AG and Georg Fischer AG from the canton were granted a concession to exploit the coal. With the help of specialists from the Gonzen mine, a veritable mine with an extensive, 7 km long tunnel system was created in a short time. Towards the end of the Second World War, the mine obtained a certain economic importance and temporarily, in 1946, the production even exceeded that from Käpfnach near Horgen. The article deals with the historical background, and pictures of the “rediscovery” of the Riedhof mine are published from the past company years.",
          "UKR": "15 травня 2002 року \"Верін Бергверк Рідхоф\" був заснований в Агстах на Альбісі. Мета асоціації - підтримувати пам’ять про регіонально важливий промисловий пам’ятник. Під час Другої світової війни шахта Рідхофа була другою за величиною вугільною шахтою в Кантоні Цюріха поряд з Капфнахом-Горген. Видобуток вугілля в шахті Рідхоф поблизу Егст Альбіс 1786 р. Фермер виявив депозит вугілля Рідхоф під час дорожніх робіт. Під державним контролем кантоном Цюріха, першої фази зриву між 1787 та 1814 роками. За відсутності достатнього закриття руху, демонтаж у 1814 році було припинено. Друга фаза видобутку розпочалася в 1917 році під час Першої світової війни. У 1919 році, після кількох змін власності, будівельна компанія Цюріха взяла на себе демонтаж на руці. Столлен керував перехресними: компанія здебільшого була невигідною. Компанія потрапила в високі борги, а тунелі були закриті в 1921 році. Однак часом у цей період працювали до 30 робітників. Загалом, однак, було підвищено лише близько 1200 тонн вугілля. Під час Другої світової війни знову відбулося демонтаж. У 1942 році Gebrüder Sulzer AG та Georg Fischer AG з кантону отримали поступку для використання вугілля. За допомогою фахівців з шахти Гонзен, справжня шахта з великою, 7 км -тунельною системою довжиною була створена за короткий час. Наприкінці Другої світової війни шахта набула певного економічного значення і тимчасово, в 1946 році, виробництво навіть перевищило це від Käpfnach поблизу Хоргену. У статті йдеться про історичне походження, а фотографії \"повторного відкриття\" шахти Рідхофа публікуються з минулих років компанії.\n"
      },
